        author: "Username",
        Date: "August 6, 2021",
        ReviewOf: "",
        Review: "Nice Place!",
    }));
    const showItems = (posts) => {
    var items = [];
    for (var i = 0; i < records; i++) {
        items.push(
        <div className="post" key={posts[i].id}>
            <h3>{`${posts[i].name} - ${posts[i].id}`}</h3>
            <p>{posts[i].body}</p>
        </div>
        );
    }
    return items;
    };
    const itemsPerPage = 20;
